import React from 'react';

const Hero = () => {
  return (
    <section 
      id="hero" 
      className="hero"
    >
      <div className="container">
        <div className="hero-content">
          <h1 className="hero-title"> </h1>
          <p className="hero-subtitle"> </p>
          <a href="#programs" className="btn">Explore Our Programs</a>
        </div>
      </div>
    </section>
  );
};

export default Hero;
